import React from 'react';

function Services() {
  const handleClick = (event) => {
    // Handle click logic here
  };

  return (
    <div className="container mx-auto max-w-[1280px] pb-2 mb-4 mt-2 md:mt-4 h-full">
      <div className="h-full">
        <div className="flex justify-center items-center">
          <div className="nav-list flex flex-col items-center">
            <ul style={{ opacity: 1 }}>
              <li className="flex flex-col my-4 px-2 md:px-8 cursor-pointer" style={{ opacity: 1, transform: 'none' }}>
                <div className="flex flex-row items-center w-full">
                  <img src="/static/media/depannageSvg.bd5a06445593cec9f64833a7de799367.svg" alt="" className="mr-5 w-28 h-24 hidden sm:block" />
                  <div className="w-full">
                    <span className="flex text-xl mb-2 py-1 px-6 bg-blue-500 text-white items-center rounded-lg">Dépannage et réparation<span className="float-right ml-auto"><svg xmlns="http://www.w3.org/2000/svg" className="h-4 w-4" fill="none" viewBox="0 0 24 24" stroke="currentColor" strokeWidth="2"><path strokeLinecap="round" strokeLinejoin="round" d="M9 5l7 7-7 7"></path></svg></span></span>
                    <span className="text-base"><p className="pl-4">Un problème de plomberie, d'électricité, de serrurerie… ? Une fuite d’eau, un chauffe-eau à remplacer... Pour toutes les prestations de dépannage ...</p></span>
                  </div>
                </div>
              </li>
              {/* Add similar li elements for other services */}
            </ul>
          </div>
        </div>
      </div>
    </div>
  );
}

export default Services;
